      function __construct() {
        $this->middleware('auth:api');
    }
    /**
     * Display a listing of the resource.
     *
     * @return \Illuminate\Http\Response
     */
    public function index()
    { 
        
        //check if the user is authorized to view users
        $this->authorize('isAdmin');
        return User::latest()->paginate(2);
    }

    /**
     * Store a newly created resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @return \Illuminate\Http\Response
     */
    public function store(Request $request)
    {
        $data = $this->validate($request, [
             "name" => "required|string|min:3|max:191",
            "email" => "required|email|max:191|unique:App\User",
            "type" => "sometimes|nullable|string|in:user,admin,author",
            "bio" => "sometimes|nullable|string",
            "password" => "required|min:6",
        ]);
        
        $data["password"] = Hash::make($data["password"]);
        
        return User::create($data);
    }

    /**
     * Display the specified resource.
     *
     * @param  \App\User  $user
     * @return \Illuminate\Http\Response
     */
    public function show(User $user)
    {
        //
    }

    /**
     * Update the specified resource in storage.
     *
     * @param  \Illuminate\Http\Request  $request
     * @param  \App\User  $user
     * @return \Illuminate\Http\Response
     */
    public function update(Request $request,  $id)
    { 
         $data = $this->validate($request, [
            "name" => "required|string|min:3|max:191",
            "email" => "required|email|max:191",
            "type" => "sometimes|nullable|string|in:user,admin,author",
            "bio" => "sometimes|nullable|string",
            "password" => "sometimes|nullable|min:6",
        ]);
         
         $validator = Validator::make($data, [
            
                    'email' => [
                        Rule::unique('users')->ignore($id),
                    ]
                 
                ]); 
        
                
                if ($validator->fails()) { 
                    
                    return response(["message" => "The email has already been taken"], 422);
                    
                }
        
          $user = User::find($id);
       
        
        if(!$user) {
           return response(["message" => "The user does not exists"], 404);

        }else {
            
            if($request->has("password") && $data["password"]){
                $data["password"] = Hash::make($data["password"]);
            }else {
                unset($data["password"]);
            }
            
           $user->update($data); 
        }
       
       
        return response(["message" => "User has been updated"], 200);
        
    
    }

    /**
     * Remove the specified resource from storage.
     *
     * @param  \App\User  $user
     * @return \Illuminate\Http\Response
     */
    public function destroy($id)
    { 
  
        $user = User::find($id);
       
        $message = "User has been deleted successfully";
        $respCode = 200;
        
        if(!$user) {
            $message = "The user does not exists";
            $respCode = 404;
        }else {
           $user->delete(); 
        }
       
       
        return response(["message" => $message], $respCode);
        
    }
    
    
    
