        public function searchUser() {
            $query = \Request::get('query');
             
            
            return User::where("name", "like", "%$query%")
                   -> orWhere("email", "like", "%$query%")
                   -> orWhere("type", "like", "%$query%")
                   ->paginate(2);
        }
    
    
